import React, { Component } from 'react';

export default class Menu extends React.Component {
	constructor() {
		super();

		this.state ={
			showMenu: false,
		}

		this.showMenu = this.showMenu.bind(this);
		this.closeMenu = this.closeMenu.bind(this);
	}







	render() {
		return (
			<p>Hi!</p>
		)
	}
}
